-- ----------------------------
--  Table structure for `house_daily`
-- ----------------------------
DROP TABLE IF EXISTS `house_daily`;
CREATE TABLE `house_daily` (
	`id` int(11) NOT NULL AUTO_INCREMENT,
	`update_time` timestamp NULL ON UPDATE CURRENT_TIMESTAMP DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
	`update_time_day` date NOT NULL COMMENT '更新时间/天',
	`update_house_cnt` int(11) DEFAULT NULL COMMENT '更新房子数量',
	`dul_house_cnt` int(11) DEFAULT NULL COMMENT '重复房子数量',
	`new_house_cnt` int(11) DEFAULT NULL COMMENT '新房子数量',
	PRIMARY KEY (`id`, `update_time_day`)
) ENGINE=`InnoDB` DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci ROW_FORMAT=DYNAMIC COMMENT='' CHECKSUM=0 DELAY_KEY_WRITE=0;

